 const SubStr= require('./substring');

function Collt(st1,datas){
var result;
var t = 0;
while(datas[t]!=null){
    if(SubStr(st1,datas[t].name)){
        result.concat(data[t]);
    }
    t++;
}
return result;
}


module.exports.Collt = Collt;
